  \"mackay-island-national-wildlife-refuge-annual-narrative-report-calendar-year-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mackay Island
  National Wildlife Refuge summarizes refuge activities for calendar year 1991. The
  report begins with a summary of weather and habitat conditions during the period.
  A planning section outlines refuge management plans, public participation, compliance
  mandates, and scientific research. The administration section discusses personnel
  actions, refuge programs, and safety. The habitat management section provides information
  on croplands, wetlands, wilderness areas, grazing, pest control, and easements for
  waterfowl. A wildlife section covers waterfowl, shorebirds, game mammals, fisheries
  resources, banding, animal control, and endangered and threatened species. The public
  use section outlines interpretive programs, recreational use, refuge visitation,
  hunting, and law enforcement. An equipment and facilities section covers new construction,
  maintenance, and communications systems. Items of interest are provided at the end
  of the report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
